SELECT MIN("IMG_OBJ_ATT"."IMG_ID") as agg_0 FROM "IMG_OBJ_ATT" LEFT OUTER JOIN "ATT_CLASSES" ON "IMG_OBJ_ATT"."ATT_CLASS_ID" = "ATT_CLASSES"."ATT_CLASS_ID"  WHERE "ATT_CLASSES"."ATT_CLASS_ID" <= 267 AND "ATT_CLASSES"."ATT_CLASS" NOT LIKE '%blue%' AND "ATT_CLASSES"."ATT_CLASS" LIKE '%dark%' AND "IMG_OBJ_ATT"."OBJ_SAMPLE_ID" >= 5